import React from 'react';
import {NavLink} from 'react-router-dom';
import Product from './Product.js';
import People from './People.js';
import logo from './logo.jpg';
import './style.css';


function Header(){
	return(
	<div>
		<h4 className="title "><img src={logo}/> Exerevnisi </h4>

	<ul className="nav-links">
		<li>
			<NavLink  to="/" className="nav1"  style={{ color:'black',textDecoration: 'none' }}>Home</NavLink>
		</li>
		<li>
			<NavLink exact to="/product" className="nav1"   style={{color:'blue', textDecoration: 'none' }}>Product</NavLink>
		</li>
		<li>
			<NavLink exact to="/people"  className="nav1"  style={{ color:'black',textDecoration: 'none' }}>People </NavLink>
		</li>
		<li>
			<NavLink to="/join us" className="nav1" style={{ color:'black',textDecoration: 'none' }}>Join Us</NavLink>
		</li>
	</ul>

	<hr/>	
	</div>

	);
}

export default Header;
